.sr-only,
.screen-reader-text {
  position: absolute;
  width: 1px;
  height: 1px;
  padding: 0;
  margin: -1px;
  overflow: hidden;
  clip: rect(0, 0, 0, 0);
  border: 0;
}

.sr-only-focusable:active,
.screen-reader-text:active,
.sr-only-focusable:focus,
.screen-reader-text:focus {
  position: static;
  width: auto;
  height: auto;
  margin: 0;
  overflow: visible;
  clip: auto;
}

/**
 * Import npm dependencies
 *
 * Prefix your imports with `~` to grab from node_modules/
 * @see https://github.com/webpack-contrib/sass-loader#imports
 */

/** Import theme styles */

.comment-list ol {
  list-style: none;
}

/** Search form */

.search-form label {
  font-weight: normal;
}

/**
 * WordPress Generated Classes
 * @see http://codex.wordpress.org/CSS#WordPress_Generated_Classes
 */

/** Media alignment */

.alignnone {
  margin-left: 0;
  margin-right: 0;
  max-width: 100%;
  height: auto;
}

.aligncenter {
  display: block;
  margin: 0.5rem auto;
  height: auto;
}

.alignleft,
.alignright {
  margin-bottom: 0.5rem;
  height: auto;
}

@media (min-width: 576px) {
  .alignleft {
    float: left;
    margin-right: 0.5rem;
  }

  .alignright {
    float: right;
    margin-left: 0.5rem;
  }
}

/** Captions */

/** Text meant only for screen readers */

body#tinymce {
  margin: 12px !important;
}

